enum VPShareFile { PDF, XLS, TXT }

extension VPShareFileExt on VPShareFile {
  String getType() {
    switch (this) {
      case VPShareFile.PDF:
        return 'pdf';
      case VPShareFile.XLS:
        return 'xls';
      case VPShareFile.TXT:
        return 'txt';
      default:
        return '';
    }
  }

  String getMimeType() {
    switch (this) {
      case VPShareFile.PDF:
        return 'application/pdf';
      case VPShareFile.XLS:
        return 'application/vnd.ms-excel';
      case VPShareFile.TXT:
        return 'text/plain';
      default:
        return '';
    }
  }

  int getFileTypeId() {
    switch (this) {
      case VPShareFile.PDF:
        return 0;
      case VPShareFile.XLS:
        return 1;
      default:
        return -1;
    }
  }
}

class VpFileHelper {
  static final VpFileHelper _singleton = VpFileHelper._internal();

  factory VpFileHelper() {
    return _singleton;
  }

  VpFileHelper._internal();

  Future<void> saveFileFromBase64(
      {required String content,
      required String fileDes,
      required String fileExt}) async {
    Uint8List bytes = base64.decode(content);
    String dir = await getDirectoryFolderPath();

    File file = File("$dir/" +
        fileDes +
        DateTime.now().millisecondsSinceEpoch.toString() +
        '.$fileExt');
    await file.writeAsBytes(bytes);
  }

  void actionShareContract(String contractContentType, {String? fileNamePrefix}) async {
    Logger.debug(contractContentType);
    Uint8List bytes = base64.decode(contractContentType);
    String dir = await getDirectoryFolderPath();

    File file = File("$dir/" +
        (fileNamePrefix ?? 'SavingContract_') +
        DateTime.now().millisecondsSinceEpoch.toString() +
        ".pdf");

    // if (Platform.isAndroid) {
    await file.writeAsBytes(bytes);
    // }

    await Share.shareFiles([file.path], mimeTypes: ['application/pdf']);
  }

  void actionShareFile(String content, String name, VPShareFile type,
      {bool? isFullFileName = false}) async {
    Logger.debug(content);
    Uint8List bytes = base64.decode(content);
    String dir = await getDirectoryFolderPath();

    // isFullFileName = false;
    File file = isFullFileName == false
        ? File('$dir/' +
            '${name}_' +
            DateTime.now().millisecondsSinceEpoch.toString() +
            ".${type.getType()}")
        : File('$dir/$name');

    // if(isFullFileName == true){
    //   bool isExits = await file.exists();
    //   if(isExits){
    //     file = File
    //   }
    // }

    await file.writeAsBytes(bytes);

    await Share.shareFiles([file.path], mimeTypes: [type.getMimeType()]);
  }

  void testShareText() async {
    String pdfData =
        "";

    Uint8List bytes = base64.decode(pdfData);
    String dir = await getDirectoryFolderPath();

    File file = File("$dir/" +
        'SHARETEXT' +
        DateTime.now().millisecondsSinceEpoch.toString() +
        ".pdf");
    file.writeAsBytes(bytes);

    Logger.debug('PATHZZZZZZ ${file.path} ');

    await Share.shareFiles([file.path], mimeTypes: ['application/pdf']);
